(9, 'Шоперы', 'shoperi', 1, 'Шоперы', NULL, 'Купить сумки шоперы в Украине. Продажа элегантных женских шоперов, модных и стильных по до ступным ценам.', 1, '2022-12-20 23:20:46', '2022-12-22 18:34:16'),
(10, 'Бананки женские', 'bananki-zhenskie', 1, 'Бананки женские', NULL, 'Купить женские сумки бананки в Украине. Продажа женских бананок по доступным ценам в ассортименте.', 1, '2022-12-20 23:21:22', '2022-12-22 18:36:02'),
(11, 'Браслеты женские', 'brasleti-zhenskie', 2, 'Браслеты женские', NULL, 'Купить женские браслеты в Украине. Ювелирные украшения - стильные женские браслеты по доступным ценам.', 1, '2022-12-21 13:41:29', '2022-12-22 18:38:34'),
(12, 'Кольца женские', 'koltsa-zhenskie', 2, 'Женские кольца', NULL, 'Купить женские кольца в Украине. Качественная бижутерия по доступной цене.', 1, '2022-12-22 18:27:36', '2022-12-22 18:27:36'),
(13, 'Ювелирные наборы', 'yuvelirnie-nabori', 2, 'Ювелирные наборы', NULL, 'Купить ювелирные наборы женские в Украине. Продажа женских стильных и модных ювелирных наборов по доступным ценам.', 1, '2022-12-22 18:43:59', '2022-12-22 18:43:59'),
(14, 'Сумки женские через плече', 'sumki-zhenskie-cherez-pleche', 1, 'Сумки женские через плече', NULL, 'Купить женские сумки через плече в Украине. Продажа стильных и модных сумок женских с ремнем через плече по доступным ценам.', 1, '2022-12-22 18:45:47', '2022-12-22 18:45:47'),
(15, 'Рюкзаки женские', 'ryukzaki-zhenskie', 1, 'Рюкзаки женские', NULL, 'Купить рюкзаки женские в Украине. Продажа модных и стильных женских рюкзаков в асортименте по приемлемым ценам.', 1, '2022-12-22 18:51:36', '2022-12-22 18:51:36'),
(16, 'Коробки и упаковка', 'korobki-i-upakovka', 0, 'Коробки и упаковка для изделий', '4.jpg', 'Купить подарочные коробки, пакеты и упаковку в Украине. Стилные подарочные пакеты, упаковка и коробки для изделий по доступным ценам.', 1, '2022-12-22 19:30:03', '2022-12-22 19:50:15'),
(17, 'Подарочные пакеты', 'podarochnie-paketi', 16, 'Подарочные пакеты для покупок', NULL, 'Купить подарочные пакеты для покупок в Украине. продажа подарочных пакетов для различных покупок по приемлемым ценам.', 1, '2022-12-22 19:51:56', '2022-12-22 19:51:56'),
(18, 'Пыльники для покупок', 'pilniki-dlya-pokupok', 16, 'Пыльники для покупок', NULL, 'Купить пыльники для покупок в Украине. Продажа пыльников для различных покупок по приемлемым ценам.', 1, '2022-12-22 19:53:19', '2022-12-22 19:53:19'),
(19, 'Кошельки', 'koshelki', 1, 'Кошельки женские', NULL, 'Женские кошельки купить в Украине.', 0, '2022-12-25 01:54:42', '2023-01-01 13:26:09'),
(20, 'Без плечевого ремня', 'bez-plechevogo-remnya', 1, 'Сумки женские с ручкой для ношения в руках, модели без плечевого ремня.', NULL, 'Большой выбор различных женских сумок всевозможных цветов и размеров модели без плечевого ремня, с ручками для ношения в руках.', 0, '2022-12-28 18:14:16', '2023-01-01 13:25:53'),
(21, 'Женская обувь', 'zhenskaya-obuv', 0, 'Интернет магазин женской обуви на сезоны зама,весна,лето,осень цена и качество супер', '5.jpg', 'Большой выбор качественной женской обуви на весну,лето,зиму,осень. Купить женскую обувь не дорого. Сочетание цена качество. Заказать в интернет магазине', 1, '2023-01-01 23:20:03', '2023-01-01 23:21:24'),
(22, 'Женские ботинки', 'zhenskie-botinki', 21, 'Женские ботинки', NULL, 'Женские ботинки на сезоны осень,зиму,весну,лето. Большой выбор ботинок женских различных размеров в наличии, качественные материалы, заказать онлайн с доставкой', 1, '2023-01-02 19:56:38', '2023-01-02 19:56:38'),
(23, 'Женская одежда', 'zhenskaya-odezhda', 0, 'Купить женскую одежду в интернет магазине.', '8.jpg', 'Купить женскую одежду на зиму,весну,осень,лето в интернет магазине. Большой ассортимент женской одежды по выгодным ценам с доставкой.', 1, '2023-01-04 15:59:25', '2023-01-04 16:11:46'),
(24, 'Платья', 'platya', 23, 'Женские платья купить в интернет магазине по выгодной цене.', NULL, 'Женские платья купить в интернет магазине по выгодной цене. Большой выбор женских платьев разных цветов и стилей. Разные размеры.', 1, '2023-01-04 16:10:31', '2023-01-04 16:12:58'),
(25, 'Боди', 'bodi', 23, 'Женские боди большой выбор цветов и фасонов, разные размеры. Купить в интернет-магазине женских модных вещей', NULL, 'Большой выбор женских боди по приемлемым ценам, разнообразные цвета и выбор размеров, заказать в интернет-магазине модные женские боди', 1, '2023-01-04 20:24:49', '2023-01-04 20:24:49'),
(26, 'Брюки и штаны', 'bryuki-i-shtani', 23, 'Большой выбор женских брюк и штанов разных цветов и фасонов, купить стильные и удобные женские штаны, брюки.', NULL, 'Женские штаны и брюки в ассортименте, много цветов и фасонов-классика,спортивные,пляжные, облегающие и широкие. Интернет магазин модной женской одежды.', 1, '2023-01-04 20:58:17', '2023-02-06 19:32:17'),
(27, 'Кофты и гольфы', 'kofti-i-golfi', 23, 'Женские кофты и гольфы в ассортименте цвета, фасоны по приемлемым ценам', NULL, 'Большой выбор женских кофт и гольфов различных расцветок и фасонов, купить качественные женские вещи по доступной цене в интернет-магазине', 1, '2023-01-04 21:12:16', '2023-01-04 21:12:16'),
(28, 'Комбинизоны', 'kombinizoni', 23, 'Купить женские комбинизоны в ассортименте, модные женские комбинизоны по лучшим ценам, только качество.', NULL, 'Большой выбор модных женских комбинизонов по лучшим ценам, фасоны и ростовка. Заказать с доставкой в интернет-магазине женских вещей.', 1, '2023-01-04 21:27:36', '2023-01-04 21:27:36'),
(29, 'Костюмы', 'zhenskie-kostyumi', 23, 'Женские костюмы брючные, с юбкой, с шортами, спортивные и классические, вечерние и деловые. Купить в интернет-магазине', NULL, 'Большой выбор можных женских костюмов, различных цветов и фасонов - спортивные костюмы, брючные костюмы, костюм с юбкой, с шортами, разные размеры заказать по выгодной цене', 1, '2023-01-05 15:57:47', '2023-01-31 21:01:26'),
(30, 'Свитера, свитшоты, худи', 'zhenskie-svitera', 23, 'Большой выбор женских свитеров ,свитшотов, худи разных размеров', NULL, 'Женские свитера, разные размеры, фасоны и цвета, все модели очень стильные, в наличии большой ассортимент женских свитеров, худи и свитшотов по выгодной цене', 1, '2023-01-11 21:12:20', '2023-02-06 20:53:51'),
(31, 'Шерты', 'zhenskie-sherti', 23, 'Купить женские шорты в интернет-магазине.', NULL, 'Большой ассортимент женских шерт разных размеров, в интернет-магазине вы можете купить женские шерты нужного цвета, фасона, размера по выгодной цене', 1, '2023-01-11 21:16:32', '2023-01-31 20:59:52'),
(32, 'Джинсы', 'zhenskie-dzhinsi', 23, 'Женские джинсы заказать в интернет-магазине по выгодной цене', NULL, 'Большой ассортимент женских джинс классических, узких, широких, синих, черных. Цены супер. Доставка по почте.', 1, '2023-01-11 21:50:02', '2023-01-31 21:00:36'),
(33, 'Лосины, леггинсы', 'losini', 23, 'Женские лосины и леггинсы в ассортименте купить в интернет-магазине модных вещей не дорого', NULL, 'Женские лосины, леггинсы по выгодным ценам, темные или светлые лосины, утепленные лосины или лосины для спорта, тут вы найдете нужную модель по хорошей цене', 1, '2023-01-11 22:01:27', '2023-02-02 13:52:28'),
(34, 'Куртки', 'zhenskie-kurtki', 23, 'Женские куртки на осень,весну,зиму по выгодной цене модные куртки не дорого', NULL, 'Большой выбор женских курток, тут вы найдете длинные женские куртки, короткие, теплые на осень-зиму или легкие на весну, размеры и ассортимент фасонов курток.', 1, '2023-01-11 22:12:40', '2023-01-31 21:00:13'),
(35, 'Топы', 'topi', 23, 'Женские топы большой ассортимент модных топов в разных цветах купить на лето', NULL, 'Женские топы цвета в ассортименте на лето, весну купить по низким цена м с доставкой', 1, '2023-01-11 23:08:09', '2023-01-11 23:08:09'),
(36, 'Юбки', 'yubki', 23, 'Женские юбки купить в интернет магазине модных женских вещей', NULL, 'Ищете модную женскую юбку, тут большой выбор женских юбок самых разных цветов и моделей, узких, зауженных, длинных, коротких, в пол и мини, макси по супер цене.', 1, '2023-01-11 23:30:53', '2023-01-11 23:30:53'),
(37, 'Футболки, лонгсливы', 'futbolki-longslivi', 23, 'Купить стильные женские футболки и лонгсливы по отличной цене, скидки и акции присутствуют', NULL, 'Купить стильные женские классические футболки и с длинными рукавами - лонгсливы разных цветов и размеров  в Украине. Цена выгодная.', 1, '2023-01-29 21:40:35', '2023-02-06 22:18:53'),
(38, 'Пижамы и ночные рубашки', 'pizhami-i-nochnie-rubashki', 23, 'Купить женские пижамы и ночные рубашки', NULL, 'В продаже женские пижамы и ночные рубашки разных цветов и фасонов, которые можно купить с доставкой в интернет-магазине по хорошей цене', 1, '2023-01-29 21:47:24', '2023-01-29 21:47:24'),
(39, 'Пиджаки и жакеты', 'pidzhaki-i-zhaketi', 23, 'Стильные пиджак и жакеты для девушек и женщин, разная длина и фасон, также жакеты.', NULL, 'Купить женские пиджаки и жакеты разных цветов и фасонов, крой классический и свободный, одежда для девушек и женщин в деловом стиле', 1, '2023-02-06 22:23:21', '2023-02-06 22:23:21'),
(40, 'Рубашки и сорочки', 'rubashki-i-sorochki', 23, 'Женские сорочки и рубашки в ассортименте, теплые и легкие, классика и спорт по доступной цене.', NULL, 'Большой выбор женской одежды, рубашек и сорочек различных размеров и фасонов. Большой выбор цветов. Теплые женские рубашки, классические женские сорочки, спортивные  и другие варианты.', 1, '2023-03-02 21:04:47', '2023-03-02 21:04:47'),
(41, 'Пальто', 'palto', 23, 'Женские пальто в ассортименте купить не дорого, ростовка и ассортимент актуальны.', NULL, 'Женские пальто в ассортименте высокое качество не дорого, актуальные современные модели. Разнообразие размеров и цветов пальто.', 1, '2023-03-03 17:43:48', '2023-03-03 17:43:48');
