(525, 1, 9, 2, 'sumochka-zhenskaya-chanel-beige-gold-ekokozha', '1750.00', 'грн', 'Сумочка женская Chanel Beige Gold экокожа', 'Модная женская сумочка Шанель из экокожи бежевая Chanel Beige Gold', 'Купить стильную женская сумочку Шанель из экокожи бежевую Chanel Beige Gold с плечевым ремнем. Два внутренних отделения с карманами, фурнитура металл под золото.', 'купить сумку', 'Сумочка Chanel Beige Gold экокожа бежевая', 'Материал сумки - экокожа. \r\nРазмеры 20x14x7 см. \r\nЕсть два внутренних отделения с карманами на змейках.\r\nФурнитура металлическая по цвету под золото.\r\nПлечевой ремень в виде позолоченой цепочки с накладкой из основного материала для плеча.\r\nВсе лого есть, брендированная фурнитура.\r\nУдобная и элегантная прямоугольная форма.\r\nИмеется откидной клапан с застежкой.', '06013', 1, 1, 'Сумочка Chanel Beige Gold ( арт 06013)\r\n\r\nЕкошкіра. Розмір 20x14x7 см. \r\nЛицьовий малюнок підібраний  симметрично. \r\nСумочка має 2 основні відділення. \r\nВсередині всі лого присутні, фурнітура брендована\r\n\r\n1400', 1, '2023-02-26 14:53:34', '2023-02-26 14:53:54', 1, 1),
(526, 1, 10, 2, 'sumka-zhenskaya-chernaya-eko-kozha-premium-guess-dream-flap-1:1', '1950.00', 'грн', 'Сумка женская черная эко кожа PREMIUM Guess Dream flap 1:1', 'Женская сумка премиум класс PREMIUM Guess Dream flap 1:1 с плечевым ремнем и ручкой', 'Женская сумочка из черной экокожи премиум класса PREMIUM Guess Dream flap 1:1, носится как через плече так и есть удобная ручка. Застежки магниты и откидной клапан.Одинарное внутреннее отделение.', 'купить сумку', 'Сумка женская черная эко кожа PREMIUM Guess Dream flap 1:1', 'Качественная фабричная сумка. \r\nРазмеры сумочки 22х15х5 см. \r\nКороткая ручка 52 см, \r\nДлинная - 115 см, регулируется по длине.\r\nЦвет-черный.\r\nВнутри имеется одинарное просторное отделение.\r\nСумка закрывается с помощью откидного клапана на защелках магнитах.\r\nФурнитура металлическая, золотистого цвета.\r\nВнутри сумки имеется боковой карман на змейке.\r\nПодкладка внутри бежевого цвета.\r\nСумка премиум класса. Для повседневного использования. \r\nОтличное сочетание цены и качества.', '07025', 1, 1, 'PREMIUM Guess Dream flap 1:1 \r\nФабричний Китай (art 07025)\r\n\r\nФабрична якість. Еко-шкіра, лого та бірка. Розмір 22х15х5 см. Коротка ручка 52 см, довга - 115 см, регулюється.\r\n\r\n1600грн', 1, '2023-02-26 17:06:22', '2023-02-26 17:06:22', 1, 1),
(528, 24, 17, 7, 'plate-chernoe-korotkoe-s-dlinnimi-rukavami-i-virezom-dekolte', '680.00', 'грн', 'Платье черное короткое с длинными рукавами и вырезом декольте', 'Купить черное короткое платье с вырезом декольте и длинными рукавами недорого на весну-лето', 'Купить черное короткое платье с вырезом декольте и длинными рукавами недорого на весну-лето. Длина миди выше колена.Свободный облегающий силуэт. Мягкая ткань с рисунком. Доставка новой почтой.', 'купить сумку', 'Платье черное короткое с длинными рукавами и вырезом декольте', 'Продается стильное легкое платье на лета, а также под одежду.\r\nТкань: софт принт\r\nЦвет: чорний\r\nРазмер: 42-44, 46-48\r\n⠀\r\nОчень нежное платье из мягкой и легкой ткани. Элегантная цветовая композиция светло-серые цветы на черном фоне.\r\nДлина платья выше колена. Свободно облегающее платье с длинными рукавами. Высокий пояс. Не смотря на свободный покрой платье отлично подчеркнет фигуру.\r\nШикарное платье на лето как основная одежда и также демисезон под куртку.', '3167', 1, 1, 'Платье черное короткое с длинными рукавами и вырезом декольте\r\nЦіна - 440 грн\r\n⠀\r\nТкань: софт принт\r\nЦвет: чорний\r\nРазмер: 42-44, 46-48\r\n⠀\r\nОчень нежное платье из мягкой и легкой ткани. Элегантная цветовая композиция светло-серые цветы на черном фоне.\r\nДлина платья выше колена. Свободно облегающее платье с длинными рукавами. Высокий пояс. Не смотря на свободный покрой платье отлично подчеркнет фигуру.\r\nШикарное платье на лето как основная одежда и также демисезон под куртку.\r\n\r\n⠀\r\nМодель 3167', 1, '2023-03-01 17:42:13', '2023-03-02 19:55:57', 1, 1),
(529, 35, 17, 7, 'top-s-dlinnimi-rukavami-tsveta-v-assortimente', '550.00', 'грн', 'Топ с длинными рукавами, цвета в ассортименте', 'Купить недорого топ с длинными рукавами цвета мокко, серый, молоко структура полоска рубчик', 'Купить недорого топ с длинными рукавами цвета мокко, серый, молоко структура полоска рубчик', 'купить сумку', 'Топ с длинными рукавами, цвета в ассортименте', 'Топ с длинными рукавами.\r\nРазмеры: 42-44, 46-48\r\nЦвета: мокко, серый, молоко\r\nТкань: рубчик\r\nКлассический женский топ с длинными рукавами. \r\nТкань хорошо тянется, мягкая. \r\nТекстура ткани - вертикальная полоска.\r\nОтличная цена и качество изделия. В продаже имеется три цвета.\r\nУказанные выше размеры можно также прочитать как S/M L/XL.', '4336', 1, 1, 'Топ с длинными рукавами.\r\n320 грн.\r\nРазмеры: 42-44, 46-48\r\nЦвета: мокко, серый, молоко\r\nТкань: рубчик\r\n\r\n4336', 1, '2023-03-02 19:55:38', '2023-03-02 19:55:38', 1, 1),
(530, 40, 17, 7, 'zhenskaya-sorochka-uteplennaya-v-kletku-kashemira', '650.00', 'грн', 'Женская сорочка утепленная в клетку кашемира', 'Купить теплую женскую сорочку с рисунком в клетку цвета беж, черный, красно-черный', 'Не дорого купить женскую сорочку с рисунком в крупную клетку в цветах бежевом, черном, красно-черном. Сорочка теплая кашемировая', 'купить одежду', 'Женская сорочка утепленная в клетку кашемира', 'Рубашка женская утепленный вариант с классическим рисунком крупной клеткой\r\n\r\nТкань: кашемир Турция\r\nРазмеры: 42-46 универсал\r\nЦвета: беж, черный, красно-черный\r\nУтепленная женская сорочка с узором клеткой представлена в магазине в трех наиболее популярных цветах.\r\nВ верхней части рубашки имеются симметрично расположеные декоративные клапаны.\r\nДанная женская сорочка может быть уместна в сочетании с нательным топом и футблокой. Может заменить легкую ветровку.\r\nРазмер изделия универсал и подойдет для размеров S, M, L.', '1012', 1, 1, 'Рубашка женская теплая рисунок клетка\r\nЦена - 500 грн\r\nТкань: кашемир Турция\r\nРазмеры: 42-46 универсал\r\nЦвета: беж, черный, красно-черный\r\nТо, что всегда актуально – теплые рубашки в клетку из кашемира. Эталон многослойных образов из сезона в сезон в самых трендовых цветах. Лучшее качество!', 1, '2023-03-02 21:27:00', '2023-03-02 21:27:00', 1, 1),
(531, 34, 17, 7, 'zhenskaya-korotkaya-vetrovka-svobodnii-pokroi-plaschevka-s-kapyushenom', '640.00', 'грн', 'Женская короткая ветровка свободный покрой плащевка с капюшеном', 'Купить модную женскую ветровку на весну-лето из плащевки с капюшеном недорого', 'Стильная просторная женская ветровка с капюшеном на весну и лето из плащевки в черном, сером, бежевом и зеленом цветах. Укороченый дизайн куртки-ветровки. Снаружи есть два накладных кармана. Очень модная не дорогая цена.', 'женская одежда', 'Женская короткая ветровка свободный силуэт плащевка с капюшеном', 'Размеры: 42-44, 46-48 или европейский аналог C/M/L/XL\r\nТкань: плащевка Эмми\r\nЦвета: черный, серый, беж, хаки\r\nСтильная женская курточка на весну и лето покрой свободного силуэта. Впереди имеются большие накладные карманы с клапанами.\r\nМатериал ветровки - плащевая ткань. Благодаря оригинальному дизайну изделие очень комфортно в носке, свободное, не стесняет движение. А наличие 4-х цветов позволит подобрать подходящий гардероб для данной курточки на свой вкус и стиль.\r\nСезоны - весна и лето. Наличие капюшена будет очень кстати в ветренную или легкую дождливую погоду.', '084', 1, 1, 'Ветровка женская\r\n\r\nРазмеры: 42-44, 46-48\r\nТкань: плащевка Эмми\r\nЦвета: черный, серый, беж, хаки\r\nМодель свободного кроя, с большими карманами. Идеальный вариант на весну и лето.\r\nВоротник - капюшон.\r\nЦентральная застежка на кнопках.\r\nАрт 084', 1, '2023-03-02 21:59:15', '2023-03-02 22:09:09', 1, 1),
(532, 34, 17, 7, 'vetrovka-zhenskaya-udlenennaya-po-tipu-plascha', '690.00', 'грн', 'Ветровка женская удлиненная по типу плаща', 'Купить женскую длинную ветровку из плащевки на змейке с карманами на весну - лето не дорого', 'Стильная женская куртка ветровка длина ниже колена по типу плаща, застегивается на змейке, качественная, купить не дорого', 'купить ветровку', 'Ветровка женская удлиненная по типу плаща', 'Размеры ветровки: 42-44,46-48,50-52\r\nТкань изделия: плащевка Канада\r\nЦвета: белый, черный, беж, оливка\r\nПо бокам есть удобные карманы с декоративными клапанами.\r\nЗастегивается данное изделие на змейке.\r\nИзделие качественное, отлично подойдет на весну-лето и начало осени.\r\nЛегкая и стильная куртка по типу элегантного плаща.\r\n\r\nРазмер: 42-44\r\nДлина изделия - 106 см.\r\nОбьем груди - 98 см.\r\nДлина рукава - 60 см.\r\n\r\nРазмер: 46-48\r\nДлина изделия - 108 см.\r\nОбьем груди - 103 см.\r\nДлина рукава - 61 см.\r\n\r\nРазмер: 50-52\r\nДлина изделия - 110 см.\r\nОбьем груди - 110 см.\r\nДлина рукава - 63 см.', '707', 1, 1, 'Ветровка женская из плащевки на змейке\r\nЦена - 460 грн\r\nРазмеры: 42-44,46-48,50-52\r\nТкань: плащевка Канада\r\nЦвета: белый, черный, беж, оливка\r\nОтличного качества!\r\nМодель 707', 1, '2023-03-03 15:23:36', '2023-03-03 15:25:35', 1, 1),
(533, 41, 17, 7, 'zhenskoe-kashemirovoe-palto-s-poyasom-midi-do-kolena', '1090.00', 'грн', 'Женское кашемировое пальто с поясом миди до колена', 'Купить светлое женское кашемировое пальто с поясом, карманами - длина миди не дорого. Качество.', 'В продаже качественное женское пальто на пуговицах из турецкого кашемира. Украшено двумя большими накладными карманами. Пальто под пояс, который идет в комплекте.', 'пальто', 'Женское кашемировое пальто на пуговицах с поясом', 'Женское кашемировое пальто с поясом.\r\nДлина пальто до колена.\r\n\r\nРазмеры: 42-44, 46-48\r\nЦвета: бежевый\r\nМатериал: турецкий кашемир (очень мягкий, теплый и приятный на ощупь)\r\n\r\nМодель без подкладки. Пальто застегивается на пуговицы. Имеется в комплекте пояс. Впереди семметрично на двух полочках расположены два накладных кармана с клапанами, которые застегиваются на пуговицы.\r\nТкань украшена легким бежевым арнаментом. Широкие манжеты на пуговицах. Воротник классический.\r\n\r\nОсновные размеры.\r\n-------------------------\r\nРазмеры 42-44\r\nОхват груди - 82-106 см. соответственно\r\nОхват талии - 62-109 см. соответственно\r\nОхват бедер - 86-113 см. соответственно\r\nДлина рукава по внутреннему шву:46 см.\r\nДлина изделия по спинке 102 см.\r\n\r\nРазмер 46-48\r\nОхват груди - 90-111 см. соответственно\r\nОхват талии - 70-114 см. соответственно\r\nОхват бедер - 98-118 см. соответственно\r\nДлина рукава по внутреннему шву:46 см.\r\nДлина изделия по спинке 103 см.', '5348', 1, 1, 'Жіноче пальто\r\nЦіна - 690 грн\r\nРозміри: 42-44, 46-48\r\nКольори: бежевий\r\nМатеріал: турецький кашемір(дуже м’який, теплий та приємний на дотик)\r\nМодель без підкладки. Пальто застібається на ґудзики, з накладними кишенями, у комплекті пояс. Супер якість!\r\nМодель 5348', 1, '2023-03-03 18:09:08', '2023-03-03 18:09:08', 1, 1),
(534, 29, 17, 7, 'zhenskii-bryuchnii-kostyum-sport-i-klassika-na-vesnu-leto', '790.00', 'грн', 'Женский брючный костюм спорт и классика на весну-лето', 'Купить модный женский брючный костюм стиль спорт и классика на весну-лето недорого', 'Современный женский костюм - кофта и брюки в стиле спортивно-классическом в трех цветах - черный, бирюзовый с белым и белый с черным. Штаны на резинке.', 'брючный костюм', 'Женский брючный костюм спорт и классика на весну-лето', 'Женский стильный костюм. Комплект - кофта и штаны. На весну и лето.\r\n\r\nТкань: креп костюмка\r\nРазмеры: 40-42, 42-44, 46-48, 50-52\r\nЦвета: белый с черным, черный с белым, голубой с белым\r\n\r\nНа модели размер 40-42\r\nПараметры модели: 172см, 90-64-91\r\n\r\nКостюм в стиле \"Спортивная классика\". Будь неотразима этой весной в оригинальном костюме с лампасами. Идеально для ярких событий и комфортабельных прогулок. Брюки палаццо с лампасами, средняя посадка. Кофта свободного кроя, рукав на манжете, сбоку две рабочие кнопки, позволяющие регулировать объем талии.', '57', 1, 1, 'Костюм\r\n🏷 Ціна - 570 грн\r\n⠀\r\n▫️Тканина: креп костюмка\r\n▫️Розміри: 40-42, 42-44, 46-48, 50-52\r\n▫️Кольори: білий з чорним, чорний з білим, голубий з білим\r\n⠀\r\nНа моделі розмір 40-42\r\nПараметри моделі: 172см, 90-64-91\r\n⠀\r\nКостюм в стилі \"Спортивна класика\". Будь неперевершена цієї весни в оригінальному костюмі з лампасами. Ідеально для яскравих подій та комфортних прогулянок. Брюки палаццо з лампасами, середня посадка. Кофта вільного крою, рукав на манжеті, збоку дві робочі кнопки, які дозволяють регулювати об\'єм талії.\r\n⠀\r\nМодель 57', 1, '2023-03-03 22:34:06', '2023-03-03 22:34:06', 1, 1),
(535, 34, 17, 7, 'vesennyaya-zhenskaya-steganaya-kurtka-na-silikone', '790.00', 'грн', 'Весенняя женская стеганая куртка на силиконе.', 'Купить женскую стеганую куртку на силиконе на весну не дорого', 'Купить женскую стеганую куртку на силиконе на весну не дорого', 'купить куртку', 'Весенняя женская стеганая куртка на силиконе.', 'Стильная женская курточка из плащевой ткани без воротника.\r\n\r\nТкань изделия: стеганная плащевка качества «Лаке»\r\nНаполнитель -  100% силикон.\r\nНа подкладке.\r\nРазмеры курточки: 42-44, 46-48\r\nКурточка идет в таких цветах: черный, беж, зеленый, малина, голубой\r\n\r\nБазовая куртка весной в ярких цветах на подкладке с утеплителем. \r\nОтлично подойдет для повседневных прогулок. Стиль сдержанный классический.\r\nЗастегивается на кнопках.', '171', 1, 1, 'Куртка\r\nЦіна - 580 грн\r\n\r\nТканина: стьобана плащівка якості «Лаке» на 100-му силіконі, підкладка\r\nРозміри: 42-44, 46-48\r\nКольора: чорний, беж, зелений , малина, блакитний\r\n\r\nБазова куртка на весну в яскравих кольорах на підкладці з утеплювачем. Ідеально підійде до твого гардеробу\r\n\r\nМодель 171', 1, '2023-03-04 21:40:32', '2023-03-04 21:49:15', 1, 1),
