(542, 29, 17, 7, 'zhenskii-kostyum-sport-dvuhnit-uzkie-shtani-i-kofta-s-karmanami', '650.00', 'грн', 'Женский костюм спорт двухнить узкие штаны и кофта с карманами', 'Купить женский спортивный костюм штаны и худи розовый, белый и черный цвета двухнить.', 'Не дорого качественный спортивно-классический брючный костюм кофта с капюшеном и карманами и зауженные к низу штаны с резинкой манжетой на щиколотке. Костюм на весну, лето и осень. С, М, Л', 'спортивный костюм', 'Женский костюм спорт двухнить узкие штаны и кофта с карманами', 'Стильный женский костюм. В комплекте идет худи и штаны с резинками внизу. \r\nСочетание спортивного и классического стилей. Ткань двухнитка. Подойдет на весну, осень и зиму. А также в прохладные летние дни.\r\nКофта с карманами и капюшеном. На штанах также есть карманы на бедрах.\r\n\r\nРазмеры: S-M, М-L\r\nТкань: турецкая двухнить\r\nЦвета: пудра, черный, белый\r\n\r\nОтличное качество!', '398', 1, 1, 'Костюм\r\n🏷 Ціна - 440 грн\r\n⠀\r\n▫️Розміри: S-M, М-L\r\n▫️Тканина: турецька двохнитка\r\n▫️Кольори: пудра, чорний, білий\r\n⠀\r\nВідмінна якість!\r\n⠀\r\nМодель 398', 1, '2023-03-06 08:45:40', '2023-03-06 08:45:40', 1, 1),
(543, 29, 17, 7, 'zhenskii-sportivnii-bryuchnii-kostyum-shtani-i-kofta-raznih-tsvetov', '720.00', 'грн', 'Женский спортивный брючный костюм, штаны и кофта разных цветов', 'Купить женский спортивный костюм штаны и кофта с капюшеном на шнурке и карманами кенгуру.', 'Женский классический спортивный костюм в комплекте худи с капюшеном и удобными карманами для рук, штаны другого цвета чем кофта, с карманами на резинке и шнурке на талии.', 'костюм спортивный', 'Женский спортивный брючный костюм, штаны и кофта разных цветов', 'Стильный спортивный костюм. Штаны и кофта не одного цвета. Сочетания цветов брюк и кофты подобраны в лучшем виде.\r\nБлагодаря данному контрасту костюм будет смотреться более выразительным и оригинальным. \r\n\r\nТкань: двухнитка\r\nРазмеры: 42-44, 44-46\r\nЦвета: серая кофта/штаны графит, серая кофта/штаны черные, белая кофта/штаны серые\r\n\r\nКлассные брючные костюмы с накаткой Yummy. Худи с карманом кенгуру, брюки внизу на резинке, с удобно расположенными карманами.', '650', 1, 1, 'Костюми Yummy\r\n🏷 Ціна - 520 грн\r\n⠀\r\n▫️Тканина: двухнитка\r\n▫️Розміри: 42-44, 44-46\r\n▫️Кольори: сіра кофта/штани графіт, сіра кофта/штани чорні, біла кофта/штани сірі\r\n⠀\r\nДуже круті костюми з накаткою Yummy. Худі з кишенею кенгуру, штани знизу на гумці, з кишенями.\r\n⠀\r\nМодель 650', 1, '2023-03-06 09:05:04', '2023-03-06 09:05:04', 1, 1),
(544, 29, 17, 7, 'kostyum-bryuchnii-cherniisiniibeliibezhevii', '950.00', 'грн', 'Костюм брючный черный,синий,белый,бежевый', 'Купить женский брючный кастюм на весну и лето пиджак с поясом и широкие брюки прямой силуэт легкая ткань костюмка', 'Продается легкий женский брючный костюм на весну и лето в четырех цветах - черный, бежевый, электрик, белый. Костюм двойка - пиджак, широкие штаны прямого покроя. Брюки с карманами.', 'купить костюм.', 'Женский брючный костюм двойка черный, синий, белый, бежевый', 'В продаже супер стильный женский костюм классический стиль.\r\nКомплект костюма двойки - брюки и пиджак с пояском.\r\nПиджак с накладными карманами по бокам с двух сторон. Застежка на пуговицах.\r\nБрюки с карманами на линии бедер.\r\n\r\nРазмеры: 42-44, 46-48\r\nТкань: костюмка\r\nЦвета: черный, беж, электрик, белый\r\n\r\nСтильный костюм 2-ка. Пиджак идет с плечиками, штаны сзади на поясе на резинке, что обеспечивает идеальную посадку!\r\nОтличное качество!', '9028', 1, 1, 'Костюм брючный (черный,синий,белый,бежевый)\r\n\r\nЦіна - 740 грн\r\nРозміри: 42-44, 46-48\r\nТканина: костюмка\r\nКольори: чорний, електрик, беж, білий\r\n\r\nСтильний костюм 2-ка. Піджак йде з плечиками, штани ззаду на поясі на резинці, що забезпечує ідеальну посадку!\r\nВідмінна якість!\r\n\r\nМодель 9028', 1, '2023-03-13 19:43:06', '2023-03-13 19:51:13', 1, 1),
(545, 1, 6, 2, 'zhenskaya-sumochka-v-stile-ysl-lou-lou-beige-mini', '1550.00', 'грн', 'Женская сумочка в стиле YSL Lou Lou Beige mini', 'Купить модную женскую светлую сумочку (Ив Сен-Лоран) YSL Lou Lou Beige mini с ремнем через плече', 'Купить модную женскую светлую сумочку (Ив Сен-Лоран) YSL Lou Lou Beige mini с ремнем через плече', 'купить сумку', 'Женская сумочка в стиле YSL Lou Lou Beige mini', 'Женская сумочка в стиле YSL Lou Lou Beige mini\r\n\r\nМатериал мягкая приятная эко-кожа, \r\nразмер 24x20x9 см. \r\n\r\nСумочка имеет три  отделения (основное с отделением-перегородкой на молнии посредине). \r\nМожно носить как кроссбоди и в два сложения на плече.  \r\nВнутри лого и нашивки внутри сумки и на ручках присутствуют', '02004', 1, 1, '1300\r\n👜 YSL Lou Lou Beige mini\r\n ( арт 02004)\r\n\r\nЖенская сумочка в стиле YSL Lou Lou Beige mini\r\n\r\nМатериал мягкая приятная эко-кожа, \r\nразмер 24x20x9 см.', 1, '2023-03-15 11:42:24', '2023-03-15 11:42:24', 1, 1),
(546, 36, 17, 7, 'yubka-s-razrezom-po-bedru-midi-na-leto', '570.00', 'грн', 'Юбка с разрезом по бедру миди на лето', 'Купить легкую юбку миди ниже колена с разрезом по бедру', 'Купить легкую юбку миди ниже колена с разрезом по бедру, пояс на резинке по талии, размеры 42-44, 46-48. Отличный вариант юбки на весну и лето. Рисунок в горошек. Цвета в ассортименте', 'купить юбку', 'Юбка с разрезом по бедру миди на лето', '▫️Ткань: софт\r\n▫️Размеры: 42-44, 46-48\r\n▫️Цвета: черный, белый, масло, молоко\r\n⠀\r\nНевероятно нежная юбка. Подойдет под любой образ, обычный или праздничный. Идеально подчеркивает талию, пояс на резиночке, разрез открывает ножки, не замедляет движение.', '414', 1, 1, 'Спідниця\r\n🏷 Ціна - 370 грн\r\n⠀\r\n▫️Тканина: софт\r\n▫️Розміри: 42-44, 46-48\r\n▫️Кольори: чорний, білий, олива, молоко\r\n⠀\r\nНеймовірно ніжна спідниця. Підійде під будь-який образ, повсякденний або святковий. Ідеально підкреслює талію, пояс на резиночці, розріз відкриває ніжки, не сповільнює рух.\r\n⠀\r\nМодель 414', 1, '2023-03-19 13:50:33', '2023-03-19 13:50:33', 1, 1),
(547, 29, 17, 7, 'zhenskii-kostyum-sherti-i-korotkaya-kurtka-na-leto', '650.00', 'грн', 'Женский костюм шерты и короткая куртка на лето', 'Купить костюм женский - шерты и короткая куртка из плащевки конец весны - лето, комплект', 'Комплект двойка шерты и короткая курточка, материал плащевка Канада, цвета комплектов шерты+куртка - синий и электрик (чернильный синий цвет)', 'костюм', 'Женский костюм шерты и короткая куртка на лето', 'Стильный женский костюм - шерты и короткая курточка из плащевой ткани. На лето. Хороший вариант для прогулок, тренеровок. Для повседневной носки. Отлично смотрится в дуэте шорты + куртка и раздельно. \r\n\r\n\r\n▫️Ткань: плащевка Канада\r\n▫️Размеры: 42-44 , 46-48\r\n▫️Цвета: темно-синий, электрик', '756', 1, 1, 'Костюм\r\n🏷 Ціна - 450 грн\r\n⠀\r\n▫️Тканина: плащівка Канада\r\n▫️Розміри: 42-44 , 46-48\r\n▫️Кольори: темно-синій , електрик\r\n⠀', 1, '2023-03-21 13:39:47', '2023-03-21 13:39:47', 1, 1);
