INSERT INTO `shipping_methods` (`id`, `owner_id`, `header`, `text`, `status`) VALUES
(1, 1, 'Как оформить данный заказ.', '<p>Доставка осуществляется Новой Почтой или Укрпочтой по тарифам перевозчика (Украина).</p>\r\n<h5>Варианты оплаты.</h5>\r\n<ul>\r\n<li><b><i class=\"text-denger\">*</i> Наложеный платеж с предоплатой 150 грн.</b></li>\r\n<li> <b>По полной предоплате.</b></li>\r\n</ul>\r\n<p class=\"text-primary\">*Данная предоплата идет в счет оплаты покупки. Если товар не забрали с почты, то 150 грн. покрывают транспортные расходы.</p>', 1),
(3, 2, 'Как оформить данный заказ.', '<p>Доставка осуществляется Новой Почтой по тарифам перевозчика (Украина).</p>\r\n<h5>Варианты оплаты.</h5>\r\n<ul>\r\n<li><b><i class=\"text-denger\">*</i> Наложеный платеж с предоплатой 150 грн.</b></li>\r\n<li> <b>По полной предоплате.</b></li>\r\n</ul>\r\n<p class=\"text-primary\">*Данная предоплата идет в счет оплаты покупки. Если товар не забрали с почты, то 150 грн. покрывают транспортные расходы.</p>', 1),
(5, 7, 'Как оформить данный заказ.', '<p>Доставка осуществляется Новой Почтой по тарифам перевозчика (Украина).</p>\r\n<h5>Варианты оплаты.</h5>\r\n<ul>\r\n<li><b><i class=\"text-denger\">*</i> Наложеный платеж с предоплатой 150 грн.</b></li>\r\n<li> <b>По полной предоплате.</b></li>\r\n</ul>\r\n<p class=\"text-primary\">*Данная предоплата идет в счет оплаты покупки. Если товар не забрали с почты, то 150 грн. покрывают транспортные расходы.</p>', 1);
